nter a number.\nThis field has a too small number.\nThis field has a too large number.\nThe answer to the quiz is incorrect.\nPor favor ingresa un email.\nPor favor ingresa una URL válida.\nPlease enter a telephone number.', 'Staff', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2023-04-03 13:45:46', '2023-04-03 13:45:46', '', 0, 'http://dev.urbanestate.com.ar/?post_type=wpcf7_contact_form&#038;p=216', 0, 'wpcf7_contact_form', '', 0),
