(226, 1, '2023-03-28 12:57:05', '2023-03-28 12:57:05', '<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"66.66{0db0cbf405c54e9536161bcc2ae39bd833af415a76ab51d48c6f572b439384b1}\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:66.66{0db0cbf405c54e9536161bcc2ae39bd833af415a76ab51d48c6f572b439384b1}\"><!-- wp:paragraph -->\n<p>Artboard 1 copy 4</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Desarrollamos proyectos inmobiliarios desde el inicio hasta la posventa.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Artboard 1 copy 4</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Seleccionamos rigurosamente la zona de emplazamiento de cada desarrollo a través de un estudio que nos permita evaluar el valor añadido para los inversores.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Nos enfocamos en abarcar la totalidad de la cadena de valor del negocio, compran- do el suelo y diseñando un proyecto de altos estándares de ubicación y habitabili- dad, así como de reventa.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Preparamos el entorno de manera inteligente, optimizando los recursos.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Construimos edificios de alta calidad con diferentes funcionalidades y tipologías, pensando en las necesidades de los inversores y de las personas y familias que los habitarán.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tenemos en cuenta la posibilidad de usufructo de las viviendas como bienes renta- bles en dólares para ayudar a nuestros clientes a optimizar sus inversiones.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Gestionamos el servicio de venta de manera eficiente, asesorando a los posibles compradores desde todos los puntos de vista profesionales, dentro de nuestra propia empresa. Por eso contamos con un equipo multidisciplinario que se implica en cada decisión.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pensamos en todas las oportunidades y posibilidades de los inversores asesorándo- los para una compra exitosa y rentable, ofreciéndoles distintas modalidades de financiación.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Una vez finalizado el proyecto y adquirido el inmueble, ofrecemos un servicio de posventa orientado a ayudar a los compradores a rentar las viviendas o a tener una experiencia óptima durante su estadía en ellas.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"33.33{0db0cbf405c54e9536161bcc2ae39bd833af415a76ab51d48c6f572b439384b1}\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:33.33{0db0cbf405c54e9536161bcc2ae39bd833af415a76ab51d48c6f572b439384b1}\"><!-- wp:image {\"id\":225,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://dev.urbanestate.com.ar/wp-content/uploads/2023/03/ESPACIOS-5-684x1024.jpg\" alt=\"\" class=\"wp-image-225\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', '', '', 'inherit', 'closed', 'closed', '', '189-revision-v1', '', '', '2023-03-28 12:57:05', '2023-03-28 12:57:05', '', 189, 'http://dev.urbanestate.com.ar/?p=226', 0, 'revision', '', 0),
