(244, 1, '2023-04-02 12:32:30', '2023-04-02 12:32:30', '<span style=\"font-weight: 400;\">El Barrio de las Artes se encuentra en el corazón de Montevideo, a pocos pasos de la Ciudad Vieja. En él habitan bastiones culturales como la Sala Verdi, el Teatro Solís, el hotel Cervantes, el Museo de las Ciencias, algunos piringundines y un encantador polo gastronómico. </span>\r\n\r\n<span style=\"font-weight: 400;\">Live Smart se encuentra próximo a la plaza Independencia, cercano a la zona comercial y de servicios, así como de varias universidades de la ciudad.</span>', 'Live Smart - Barrio de las Artes', '', 'publish', 'closed', 'closed', '', 'live-smart-barrio-de-las-artes', '', '', '2023-05-10 15:42:48', '2023-05-10 15:42:48', '', 0, 'http://dev.urbanestate.com.ar/?post_type=proyecto&#038;p=244', 0, 'proyecto', '', 0),
(246, 1, '2023-04-02 12:45:34', '2023-04-02 12:45:34', '<span style=\"font-weight: 400;\">El Barrio de las Artes se encuentra en el corazón de Montevideo, a pocos pasos de la Ciudad Vieja. En él habitan bastiones culturales como la Sala Verdi, el Teatro Solís, el hotel Cervantes, el Museo de las Ciencias, algunos piringundines y un encantador polo gastronómico. </span>\r\n\r\n<span style=\"font-weight: 400;\">Live Suites se encuentra próximo a la plaza Independencia, cercano a la zona comercial y de servicios, así como de varias universidades de la ciudad.</span>', 'Live Suites - Barrio de las Artes', '', 'publish', 'closed', 'closed', '', 'live-suites-barrio-de-las-artes', '', '', '2023-05-10 15:42:06', '2023-05-10 15:42:06', '', 0, 'http://dev.urbanestate.com.ar/?post_type=proyecto&#038;p=246', 0, 'proyecto', '', 0),
(248, 1, '2023-04-04 08:46:27', '2023-04-04 08:46:27', '<span style=\"font-weight: 400;\">El barrio de Belgrano C es un barrio residencial histórico de la ciudad de Buenos Aires. En él habitan eclécticas y pintorescas casonas antiguas, el Museo Histórico Sarmiento, la Parroquia Inmaculada Concepción, famosa por su forma circular, entre otros sitios históricos y culturales de interés. </span>\r\n\r\n<span style=\"font-weight: 400;\">Junto al Barrio Chino, se ubica la estación de trenes de Belgrano, en la que se emplaza una moderna oferta gastronómica y otras atracciones. Además, el barrio cuenta con múltiples espacios verdes y una gran oferta comercial y de servicios. </span>\r\n\r\n<span style=\"font-weight: 400;\">Live Olazabal se ubica próximo a la Estación y a pocas cuadras de la línea de Subte D. A sólo dos cuadras de la Av. Cabildo.</span>', 'Live Olazabal - Belgrano', '', 'publish', 'closed', 'closed', '', 'live-olazabal-belgrano', '', '', '2023-05-03 15:49:39', '2023-05-03 15:49:39', '', 0, 'http://dev.urbanestate.com.ar/?post_type=proyecto&#038;p=248', 0, 'proyecto', '', 0),
(250, 1, '2023-04-04 07:47:08', '2023-04-04 07:47:08', '<span style=\"font-weight: 400;\">El barrio de Belgrano C es un barrio residencial histórico de la ciudad de Buenos Aires. En él habitan eclécticas y pintorescas casonas antiguas, el Museo Histórico Sarmiento, la Parroquia Inmaculada Concepción, famosa por su forma circular, entre otros sitios históricos y culturales de interés. </span>\r\n\r\n<span style=\"font-weight: 400;\">Junto al Barrio Chino, se ubica la estación de trenes de Belgrano, en la que se emplaza una moderna oferta gastronómica y otras atracciones. Además, el barrio cuenta con múltiples espacios verdes y una gran oferta comercial y de servicios. </span>\r\n\r\n<span style=\"font-weight: 400;\">Live Plaza se ubica próximo a la Estación y a pocas cuadras de la línea de Subte D. A sólo dos cuadras de la Av. Cabildo.</span>', 'Live Plaza - Belgrano', '', 'publish', 'closed', 'closed', '', 'live-plaza-belgrano', '', '', '2023-05-03 15:51:50', '2023-05-03 15:51:50', '', 0, 'http://dev.urbanestate.com.ar/?post_type=proyecto&#038;p=250', 0, 'proyecto', '', 0),
(252, 1, '2023-04-04 06:47:39', '2023-04-04 06:47:39', '<span style=\"font-weight: 400;\">El barrio de Belgrano C es un barrio residencial histórico de la ciudad de Buenos Aires. En él habitan eclécticas y pintorescas casonas antiguas, el Museo Histórico Sarmiento, la Parroquia Inmaculada Concepción, famosa por su forma circular, entre otros sitios históricos y culturales de interés. </span>\r\n\r\n<span style=\"font-weight: 400;\">Junto al Barrio Chino, se ubica la estación de trenes de Belgrano, en la que se emplaza una moderna oferta gastronómica y otras atracciones. Además, el barrio cuenta con múltiples espacios verdes y una gran oferta comercial y de servicios. </span>\r\n\r\n<span style=\"font-weight: 400;\">Live &amp; Work se ubica próximo a la Estación y a pocas cuadras de la línea de Subte D. A sólo dos cuadras de la Av. Cabildo.</span>', 'Live & Work - Belgrano', '', 'publish', 'closed', 'closed', '', 'live-work-belgrano', '', '', '2023-04-25 14:19:16', '2023-04-25 14:19:16', '', 0, 'http://dev.urbanestate.com.ar/?post_type=proyecto&#038;p=252', 0, 'proyecto', '', 0),
(254, 1, '2023-04-04 05:30:08', '2023-04-04 05:30:08', '<span style=\"font-weight: 400;\">El barrio de Belgrano, próximo a Colegiales, es un área residencial ideal para familias. Se encuentra poblado de restaurantes, cercano a Palermo Hollywood y Cañitas, con una gran oferta cultural, de ocio y recreación. </span>\r\n\r\n<span style=\"font-weight: 400;\">Además, se trata de una zona con numerosos espacios verdes y amplitud de servicios, muy bien comunicada, gracias a su cercanía con la estación de tren Colegiales y la estación Olleros  y José Hernández de la línea de subte D. </span>\r\n\r\n<span style=\"font-weight: 400;\">Live Ciudad se encuentra emplazado a tan solo una cuadra de la Av. Cabildo. </span>', 'Live Ciudad - Belgrano', '', 'publish', 'closed', 'closed', '', 'live-ciudad-belgrano', '', '', '2023-04-25 14:57:23', '2023-04-25 14:57:23', '', 0, 'http://dev.urbanestate.com.ar/?post_type=proyecto&#038;p=254', 0, 'proyecto', '', 0),
(256, 1, '2023-04-04 05:48:38', '2023-04-04 05:48:38', '<span style=\"font-weight: 400;\">Núñez es un barrio soñado, gracias a su cercanía con el río, sus espacios verdes con bulevares arbolados, y su tranquilidad. Suma multiplicidad de servicios y ofertas de ocio y placer.</span>\r\n\r\n<span style=\"font-weight: 400;\">En el último año, el polo gastronómico de Núñez sumó 50 locales a su creciente y variada oferta de bares y restoranes. </span>\r\n\r\n<span style=\"font-weight: 400;\">Live Boulevard se emplaza próximo a la Av. Cabildo con su traza del Metrobús, frente al Boulevard San Isidro Labrador, un paseo recientemente renovado y puesto en valor.</span>', 'Live Boulevard - Núñez', '', 'publish', 'closed', 'closed', '', 'live-boulevard-nunez', '', '', '2023-05-03 15:54:59', '2023-05-03 15:54:59', '', 0, 'http://dev.urbanestate.com.ar/?post_type=proyecto&#038;p=256', 0, 'proyecto', '', 0),
(258, 1, '2023-04-04 04:49:12', '2023-04-04 04:49:12', '<span style=\"font-weight: 400;\">El barrio de Belgrano, próximo a Colegiales, es un área residencial ideal para familias. Se encuentra poblado de restaurantes, cercano a Palermo Hollywood y Cañitas, con una gran oferta cultural, de ocio y recreación. </span>\r\n\r\n<span style=\"font-weight: 400;\">Además, se trata de una zona con numerosos espacios verdes y amplitud de servicios, muy bien comunicada, gracias a su cercanía con la estación de tren Colegiales y la estación Olleros  y José Hernández de la línea de subte D. </span>\r\n\r\n<span style=\"font-weight: 400;\">Live Zabala se encuentra emplazado a tan solo media cuadra de la Av. Cabildo. </span>', 'Live Zabala - Núñez', '', 'publish', 'closed', 'closed', '', 'live-zabala-nunez', '', '', '2023-05-09 13:43:46', '2023-05-09 13:43:46', '', 0, 'http://dev.urbanestate.com.ar/?post_type=proyecto&#038;p=258', 0, 'proyecto', '', 0),
(260, 1, '2023-04-04 03:49:39', '2023-04-04 03:49:39', '<span style=\"font-weight: 400;\">Villa Urquiza es un barrio en constante expansión, poblado de espacios verdes y con una gran oferta cultural y deportiva. </span>\r\n\r\n<span style=\"font-weight: 400;\">En él conviven estéticas sofisticadas y modernas. Ideal para familias jóvenes que buscan un lugar diferente dentro de la Ciudad, ya que se encuentra estratégicamente ubicado. </span>\r\n\r\n<span style=\"font-weight: 400;\">Live Urquiza se emplaza próximo a la Estación de Tren Urquiza y a pocas cuadras de la estación Juan Manuel de Rosas de la línea de Subte B, a sólo 1 cuadra de Roosevelt, donde se encuentra el nuevo paseo gastronómico.</span>', 'Live Urquiza - Urquiza', '', 'publish', 'closed', 'closed', '', 'live-urquiza-urquiza', '', '', '2023-04-25 16:03:06', '2023-04-25 16:03:06', '', 0, 'http://dev.urbanestate.com.ar/?post_type=proyecto&#038;p=260', 0, 'proyecto', '', 0),
