(423, 1, '2023-05-03 15:50:51', '2023-05-03 15:50:51', '<span style=\"font-weight: 400;\">Núñez es un barrio soñado, gracias a su cercanía con el río, sus espacios verdes con bulevares arbolados y su tranquilidad. Suma multiplicidad de servicios y ofertas de ocio y placer. </span>\r\n\r\n<span style=\"font-weight: 400;\">En el último año, el polo gastronómico de Núñez sumó 50 locales a su creciente y variada oferta de bares y restoranes. </span>\r\n\r\n<span style=\"font-weight: 400;\">Live BLV se emplaza próximo a la Av. Cabildo con su traza del Metrobús, frente al Boulevard San Isidro Labrador, un paseo recientemente renovado y puesto en valor.</span>', 'Live BLV - Nuñez', '', 'inherit', 'closed', 'closed', '', '276-autosave-v1', '', '', '2023-05-03 15:50:51', '2023-05-03 15:50:51', '', 276, 'http://dev.urbanestate.com.ar/?p=423', 0, 'revision', '', 0),
