(447, 1, '2023-04-25 17:48:03', '2023-04-25 17:48:03', 'El Barrio de las Artes se encuentra en el corazón de Montevideo, a pocos pasos de la Ciudad Vieja. En él habitan bastiones culturales como la Sala Verdi, el Teatro Solís, el hotel Cervantes, el Museo de las Ciencias, algunos piringundines y un encantador polo gastronómico.\r\n\r\nLive Soho se encuentra próximo a la plaza Independencia, cercano a la zona comercial y de servicios, así como de varias universidades de la ciudad.', 'Live Soho - Barrio de Las Artes', '', 'publish', 'closed', 'closed', '', 'live-soho', '', '', '2023-05-08 14:13:31', '2023-05-08 14:13:31', '', 0, 'http://dev.urbanestate.com.ar/?post_type=proyecto&#038;p=447', 0, 'proyecto', '', 0),
