(488, 1, '2023-05-08 14:06:20', '2023-05-08 14:06:20', '<span style=\"font-weight: 400;\">El barrio de Belgrano C es un barrio residencial histórico de la ciudad de Buenos Aires. En él habitan eclécticas y pintorescas casonas antiguas, el Museo Histórico Sarmiento, la Parroquia Inmaculada Concepción, famosa por su forma circular, entre otros sitios históricos y culturales de interés. </span>\r\n\r\n<span style=\"font-weight: 400;\">Junto al Barrio Chino, se ubica la estación de trenes de Belgrano, en la que se emplaza una moderna oferta gastronómica y otras atracciones. Además, el barrio cuenta con múltiples espacios verdes y una gran oferta comercial y de servicios. </span>\r\n\r\n<span style=\"font-weight: 400;\">Live &amp; Work se ubica próximo a la Estación y a pocas cuadras de la línea de Subte D. A sólo dos cuadras de la Av. Cabildo.</span>', 'Live & Work - Belgrano', '', 'inherit', 'closed', 'closed', '', '252-autosave-v1', '', '', '2023-05-08 14:06:20', '2023-05-08 14:06:20', '', 252, 'http://dev.urbanestate.com.ar/?p=488', 0, 'revision', '', 0),
