(492, 1, '2023-05-08 14:13:34', '2023-05-08 14:13:34', 'El Barrio de las Artes se encuentra en el corazón de Montevideo, a pocos pasos de la Ciudad Vieja. En él habitan bastiones culturales como la Sala Verdi, el Teatro Solís, el hotel Cervantes, el Museo de las Ciencias, algunos piringundines y un encantador polo gastronómico.\r\n\r\nLive Soho se encuentra próximo a la plaza Independencia, cercano a la zona comercial y de servicios, así como de varias universidades de la ciudad.', 'Live Soho - Barrio de Las Artes', '', 'inherit', 'closed', 'closed', '', '447-autosave-v1', '', '', '2023-05-08 14:13:34', '2023-05-08 14:13:34', '', 447, 'http://dev.urbanestate.com.ar/?p=492', 0, 'revision', '', 0),
