(497, 1, '2023-05-10 16:00:06', '2023-05-10 16:00:06', '<span style=\"font-weight: 400;\">El Barrio de las Artes se encuentra en el corazón de Montevideo, a pocos pasos de la Ciudad Vieja. En él habitan bastiones culturales como la Sala Verdi, el Teatro Solís, el hotel Cervantes, el Museo de las Ciencias, algunos piringundines y un encantador polo gastronómico. </span>\r\n\r\n<span style=\"font-weight: 400;\">Live Smart se encuentra próximo a la plaza Independencia, cercano a la zona comercial y de servicios, así como de varias universidades de la ciudad.</span>', 'Live Smart - Barrio de las Artes', '', 'inherit', 'closed', 'closed', '', '244-autosave-v1', '', '', '2023-05-10 16:00:06', '2023-05-10 16:00:06', '', 244, 'http://dev.urbanestate.com.ar/?p=497', 0, 'revision', '', 0),
